// ✅ NovoTutor.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

const NovoTutor = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    telefone: '',
    email: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    ativo: true,
    observacoes: ''
  });
  const [errors, setErrors] = useState({});

  const formatarCPF = (valor) => valor.replace(/\D/g, '').slice(0, 11)
    .replace(/(\d{3})(\d)/, '$1.$2')
    .replace(/(\d{3})(\d)/, '$1.$2')
    .replace(/(\d{3})(\d{1,2})$/, '$1-$2');

  const formatarTelefone = (valor) => valor.replace(/\D/g, '').slice(0, 11)
    .replace(/(\d{2})(\d)/, '($1) $2')
    .replace(/(\d{5})(\d)/, '$1-$2');

  const handleChange = e => {
    const { name, value } = e.target;
    let val = value;
    if (name === 'cpf') val = formatarCPF(val);
    if (name === 'telefone') val = formatarTelefone(val);
    setForm(f => ({ ...f, [name]: val }));
    setErrors(err => ({ ...err, [name]: null }));
  };

  const validate = () => {
    const cpfNum = form.cpf.replace(/\D/g, '');
    const telNum = form.telefone.replace(/\D/g, '');
    const errors = {};
    if (!form.nome.trim() || /[^A-Za-z\u00C0-\u017F\s]/.test(form.nome)) errors.nome = 'Nome deve conter apenas letras';
    if (!cpfNum || cpfNum.length !== 11) errors.cpf = 'CPF deve conter exatamente 11 números';
    if (!telNum || telNum.length < 10) errors.telefone = 'Telefone deve ter DDD + número (10 ou 11 dígitos)';
    if (!form.email.includes('@')) errors.email = 'Email inválido';
    if (!form.endereco.trim()) errors.endereco = 'Endereço é obrigatório';
    if (!form.dataNascimento) errors.dataNascimento = 'Data de nascimento é obrigatória';
    return errors;
  };

  const handleSubmit = async e => {
    e.preventDefault();
    const valids = validate();
    setErrors(valids);
    if (Object.keys(valids).length === 0) {
      try {
        await api.post('/tutores', form);
        navigate('/tutores');
      } catch (err) {
        const resp = err.response?.data;
        if (resp?.erros) {
          const fieldErrors = resp.erros.reduce((acc, cur) => ({ ...acc, [cur.path]: cur.msg }), {});
          setErrors(fieldErrors);
        } else {
          setErrors({ form: resp?.erro || 'Erro ao cadastrar tutor' });
        }
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white">
        <h2>Cadastrar Novo Tutor</h2>
        {errors.form && <div className="alert alert-danger">{errors.form}</div>}
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label>Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
            {errors.nome && <div className="text-danger">{errors.nome}</div>}
          </div>
          <div className="mb-3">
            <label>CPF</label>
            <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
            {errors.cpf && <div className="text-danger">{errors.cpf}</div>}
          </div>
          <div className="mb-3">
            <label>Telefone</label>
            <input name="telefone" className="form-control" value={form.telefone} onChange={handleChange} />
            {errors.telefone && <div className="text-danger">{errors.telefone}</div>}
          </div>
          <div className="mb-3">
            <label>Email</label>
            <input name="email" className="form-control" value={form.email} onChange={handleChange} />
            {errors.email && <div className="text-danger">{errors.email}</div>}
          </div>
          <div className="mb-3">
            <label>Endereço</label>
            <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
            {errors.endereco && <div className="text-danger">{errors.endereco}</div>}
          </div>
          <div className="mb-3">
            <label>Data de Nascimento</label>
            <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
            {errors.dataNascimento && <div className="text-danger">{errors.dataNascimento}</div>}
          </div>
          <button className="btn btn-success" type="submit">Cadastrar</button>
        </form>
      </div>
    </div>
  );
};

export default NovoTutor;
